import React from 'react';
import Layout from './components/Layout';
import Tap from './components/Tap';

import { Main as MainLayout } from 'layouts';

const Cs = () => {
  return (
    <MainLayout>
      <div style={{ margin: '10rem' }}>
        <Tap />
      </div>
    </MainLayout>
  );
};

export default Cs;
